// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/utils/Context.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";

import "./CreatorToken.sol";
import "./Ven.sol";

contract CreatorTokenFactory is Context {
	IERC20 parent_token;
	CreatorToken rootAbiToken;

	event CreatorTokenCreate(address indexed token, address indexed creator);

	constructor(IERC20 _parent_token) Context() {
		parent_token = _parent_token;
		rootAbiToken = new CreatorToken();
	}

	function createToken(string memory _name, string memory _symbol) public returns (CreatorToken) {
		CreatorToken token = CreatorToken(Clones.clone(address(rootAbiToken)));

		token.initialize(_name, _symbol, parent_token);
		token.transferOwnership(_msgSender());

		emit CreatorTokenCreate(address(token), _msgSender());
		return token;
	}
}
